        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">تحدد رؤية <span class\\="xis-windowItem">النتائج المختلفة</span> عناصر البيانات في تقريرك والتي ربما تكون قد تأثرت بقيَم النتائج المختلفة. </p><p class\\="xis-paragraph">لعرض تحليل للنتائج المختلفة لقياس ما، انقر فوق <span data-icon-name\\="information" alt\\="أيقونة المعلومات" aria-label\\="أيقونة المعلومات"></span> بجانب القياس، ثم انقر فوق <span class\\="xis-windowItem">عرض تحليل النتائج المختلفة</span> في النافذة المنبثقة.</p><p class\\="xis-paragraph">لعرض تأثيرات النتائج المختلفة على الكائنات في تقريرك، انقر فوق <span class\\="xis-windowItem">تحليل الكائنات بالنسبة للتأثير</span>. عندما يكتمل التحليل، انقر فوق <span class\\="xis-windowItem">التفاصيل</span> بجانب اسم كائن ما للاطلاع على تحليل مفصَّل للنتائج المختلفة في ذلك الكائن.</p><div class\\="xis-note"><span class\\="xis-noteGenText">ملاحظة\\:</span>تحدد رؤية <span class\\="xis-windowItem">النتائج المختلفة</span> جميع النتائج المختلفة في مصادر بياناتك، حتى إذا كانت كائنات تقريرك تستثني القيَم باستخدام عوامل التصفية أو التصنيفات.</div></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.LinkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد وظيفة الارتباط التي تستخدم لربط النموذج اللوجيستي بتوزيع الاستجابة الثنائية.                 </p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.eventLevel.label.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.reusePredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يسمح باستخدام أداة التوقع بشكل متكرر في قواعد التقسيم إلى عقدة طرفية. عند عدم التحديد، يمكن أن تظهر أداة التوقع مرة واحدة فقط في قواعد التقسيم التراكمية إلى عقدة طرفية.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يعرض جميع المخططات التقييمية المتاحة، بما في ذلك مصفوفة الارتباك وROC والرفع والخطأ في التصنيف.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد العدد الأقصى من التجمّعات المعروضة عندما تتجاوز بيانات الخريطة حد بيانات النظام. إذا لم تتجاوز بيانات الخريطة حد بيانات النظام، فهذا الخيار بلا تأثير.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">أزِل عناصر التحكم من منطقة المطالبة بالتقرير لإزالة المشكلة التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية المتوسطة، قلّل عدد عناصر التحكم في منطقة المطالبة بالتقرير إلى 10 أو أقل.</p><p class\\="xis-paragraph">الأولوية المتوسطة\\: تحتوي على &gt; 10 كائنات في منطقة المطالبة بالتقرير.</p></section>',
        "vaeua-gui-eua.sas.van.splineEffect.complete.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.logisticRegression.gradientConversion.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.auto_stop_method.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.leafSize.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد الحد الأدنى لعدد الملاحظات المسموح بها في العقدة الطرفية (الطرفية).</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد القوة النسبية للقوى المحلية بالنسبة إلى القوى العالمية عند وضع العقد والارتباطات. يتم تحديد تخطيط العقد والارتباطات بواسطة خوارزميات موجهة بقوة. تعثر الخوارزميات على مواقع العقد التي ليست قريبة جدًا من بعضها البعض والارتباطات التي تكون بنفس الطول.</p><p class\\="xis-paragraph">بصفة عامة، كلما ارتفعت قيمة <span class\\="xis-windowItem">Force strength</span> ازدادت المسافة بين العقدات في الشبكة.</p></section>',
