        "vaeua-gui-eua.barLabelFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">خيار <span class\\="xis-windowItem">معالجة التراكب</span> تحدد الإجراء الذي يتم أخذه لعرض تسميات الأشرطة عندما لا توجد مساحة كافية لعرضها ويحدث بينهم تراكب.</p><div class\\="xis-paragraph">                      <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">تلقائي</span></td><td>يعدّل التسميات تلقائيًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">بلا</span></td><td>لا يقوم بإجراء أي معالجة تراكب.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">قلّل عدد الفئات المخصصة لإزالة المشكلة التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية المنخفضة، قلّل عدد الفئات المخصصة في تقريرك إلى 25 أو أقل.</p><p class\\="xis-paragraph">الأولوية المنخفضة\\: تحتوي على &gt; 25 فئة مخصصة</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد إذا كان مستخرج الكيان يستخدم القائمة القياسية للكيانات أم لا.</p></section>',
