        "vaeua-gui-eua.ModelComparisonBasePropertiesView.predictionCutoff.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد انقطاع احتمالية التنبؤ الذي يحدد ما إذا كانت الملاحظة هي حدث نموذجي.</p></section>',
