        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.useEntityExtraction.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.partialdependence.numObs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد الحد الأقصى لعدد الملاحظات للحصول على عينات من بيانات الإدخال المُستخدمة لإنشاء توقعات النموذج المعروضة في مخطط الاعتماد الجزئي.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
