        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.Options.alternativeText.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد اسمًا قابلاً للوصول إليه وذا معنى لكائن. يتم الإعلان عن النص بواسطة قارئ الشاشة عندما ينتقل مستخدم إلى الكائن.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يضم اتصالات بين كل عصبون إدخال وعصبون هدف في الشبكة.</p></section>',
        "vaeua-gui-eua.properties.sankey.compress.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.factmac.learnStep.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد خيار <span class\\="xis-windowItem">عرض قيم العلامات</span> الطريقة المستخدمة لملاءمة قيم علامة التحديد على المحور س. يمكنك تحديد إما <span class\\="xis-windowItem">تقليل التراكب تلقائيًا</span> أو <span class\\="xis-windowItem">الاتجاه الثابت</span>.</p><div class\\="xis-paragraph">يتم تطبيق خيار <span class\\="xis-windowItem">تقليل التداخل تلقائيًا</span> فقط عند تداخل قيم العلامات. يمكنك تحديد ما يلي\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">تعرّج، اقتطاع، إفلات</span></td><td>يبدل القيم بالتناوب لأعلى ولأسفل، ويقص الأحرف من قيم العلامات، ثم يسقط قيم العلامات.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة</span></td><td>يدور كل قيم العلامات 45 درجة قطريًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">تعرّج، اقتطاع</span></td><td>يبدل قيم العلامات بالتناوب لأعلى ولأسفل، ثم يقص الأحرف من قيم العلامات.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">اقتطاع</span></td><td>يقص الأحرف من قيم العلامات.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">اقتطاع، تدوير بزاوية 45 درجة</span></td><td>يقص الأحرف من قيم العلامات ويدور كل قيم العلامات 45 درجة قطريًا.</td></tr></table></div>                 </div><div class\\="xis-paragraph">يتم تطبيق خيار <span class\\="xis-windowItem">الاتجاه الثابت</span> دائمًا ويعين اتجاه القيم. يمكنك تحديد ما يلي\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">أفقي</span></td><td>يعرض قيم العلامات أفقيًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة</span></td><td>يدور كل قيم العلامات 45 درجة قطريًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة، إسقاط</span></td><td>يقوم بتدوير كل قيم العلامات 45 درجة قطريًا، ثم يسقط قيم العلامات.</td></tr></table></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.identifyTermRoles.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يؤدي إلى تحديد متغير خلفي سريع لتحديد ما هي المتغيرات التي يتم أخذها في الاعتبار لإنشاء النموذج. فقط يتم اعتبار المتغيرات التي تشتمل على قيم <span class\\="xis-userSuppliedValue">p</span>- دون مستوى الأهمية المحددة.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.SlowReportLoad.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يستغرق تقريرك وقتًا طويلاً لتحميل الصفحة الأولى. إذا تعرّف SAS Visual Analytics على مشاكل الأداء بخلاف أوقات التحميل البطيء، أصلِح هذه المشاكل أولاً. إذا لم يتم تعريف مشاكل الأداء الأخرى، اتصل بالمسؤول لتحديد ما إذا كانت العوامل الأخرى تؤثر على تقريرك أم لا. على سبيل المثال، يمكن أن يتسبب الاتصال البطيء في تحميل التقرير ببطء.</p><p class\\="xis-paragraph">الأولوية المنخفضة\\: تستغرق &gt;\\= 5 ثوانٍ</p><p class\\="xis-paragraph">الأولوية المتوسطة\\: تستغرق &gt;\\= 10 ثوانٍ</p><p class\\="xis-paragraph">الأولوية العالية\\: تستغرق &gt;\\= 25 ثانية</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.neuralnetwork.activationlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد وظيفة التنشيط المستخدمة لإنشاء طبقة الإخراج عند استخدام توزيع عادي لنمذجة الاستجابة. وتستخدم دالة التفعيل الأسية مع توزيع غاما أو Poisson. </p></section>',
        "vaeua-gui-eua.va.saveToObjectsPaneWithData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">قم بتضمين عناصر البيانات ذات الصلة (تعيينات الدور وعوامل التصفية وما إلى ذلك) مع الكائن المحفوظ.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.heatmap.binCountNotApplicableToNonMeasures.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
