        "vaeua-gui-eua.barSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">خيار <span class\\="xis-windowItem">المسافات</span> يحدد المسافة بين الأشرطة.</p><p class\\="xis-paragraph">للأشرطة المجَمعة ذات نظم المجموعات، تظهر المسافة بين نظم المجموعات. لا توجد مسافات بين الأشرطة الفردية داخل أي نظام مجموعة.</p></section>',
