        "vaeua-gui-eua.sas.van.ReportReview.HighDataObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">قلّل عدد الكائنات لإزالة المشاكل التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية المتوسطة، قلّل عدد الكائنات في تقريرك إلى 12 أو أقل.</p><p class\\="xis-paragraph">الأولوية المنخفضة\\: تحتوي على &gt; 7 كائنات على الصفحة</p><p class\\="xis-paragraph">الأولوية المتوسطة\\: تحتوي على &gt; 12 كائن على الصفحة</p></section>',
