        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد القيمة (الافتراضية) الأولية لعنصر التحكم. يتم تحديد القيمة الأولية أول مرة يفتح فيها مستخدم التقرير، أو عندما يحدد مستخدم <span class\\="xis-windowItem">استعادة حالة التقرير الافتراضية</span>. </p><div class\\="xis-paragraph">أدخِل قيمة في حقل النص، أو حدد أحد الخيارات التالية\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تلقائي</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن اختيارك محفوظ كالقيمة الأولية عندما تحفظ التقرير. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">الحد الأدنى للقيمة</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> يحدد أن أدنى قيمة في عنصر التحكم هي القيمة الأولية.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">الحد الأقصى للقيمة</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> يحدد أن أكبر قيمة في عنصر التحكم هي القيمة الأولية.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">اسم المعلمة</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن القيمة للمعلمة التي تحددها هي القيمة الأولية لعنصر التحكم.</p><p class\\="xis-paraSimple">يمكنك تحديد معلمة فقط إذا كانت المعلمة ذات نوع البيانات المناسب موجودة بالفعل.</p></dd></dl></div>                 </div></section>',
