        "vaeua-gui-eua.connectOrder.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">خيار <span class\\="xis-windowItem">ترتيب التوصيل</span> يحدد كيفية توصيل نقاط البيانات لتكوين المخططات الخطية. <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">المحور</span></td><td>يقوم بتوصيل نقاط البيانات كمثل حدوثها من اليسار إلى اليمين على المحور س.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">البيانات</span></td><td>يقوم بتوصيل نقاط البيانات بالترتيب الذي تتم قراءتها به من الدور X.</td></tr></table></div>                 </div><p class\\="xis-paragraph">يمكنك استخدام هذه القيمة لضمان توصيل مرتَّب عند عدم فرز بيانات الإدخال حسب الدور X.</p></section>',
