        "vaeua-gui-eua.Properties.svm.missingvalue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يوسّع النموذج ليشمل الملاحظات ذات القيم المفقودة ولتضمين القيم المفقودة في متغير الاستجابة. تعامل عوامل التنبية الفئوية قيمة مفقودة كقيمة منفصلة. يستبدل متنبئ مستمر قيمة مفقودة مع متوسط المتنبئ.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.maximumSeconds.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يستخدم الحد الأقصى للوقت الافتراضي لتدريب الشبكة العصبية. الافتراضي هو 270. </p></section>',
