        "vaeua-gui-eua.yAxisTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">يحدد خيار <span class\\="xis-windowItem">عرض قيم العلامات</span> الطريقة المستخدمة لملاءمة قيم علامة التحديد على المحور ص. يمكنك تحديد ما يلي\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">إفلات البعض</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يقوم بإسقاط بعض قيم العلامات.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">إظهار الكل</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يعرض كل قيم العلامات.</p></dd></dl></div>                 </div></section>',
