        "vaeua-gui-eua.react.va.geo.search.exitSelectionMode.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يؤدي الخروج من وضع التحديد إلى إزالة القدرة على النقر فوق الخريطة لتحديد موقع. لإعادة تمكين وضع التحديد، حدد حقل <span class\\="xis-windowItem">الموقع</span> الفارغ.</p></section>',
