        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruning.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد عدوانية لوغاريتمية شجرة التنقيح استنادًا إلى لوغاريتمية C4.5. وهناك لوغاريتمية أكثر عدوانية تؤدي إلى شجرة أصغر.</p></section>',
