        "vaeua-gui-eua.Properties.svm.missingvalue.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد أن البيانات غير مُجمّعة.</p><p class\\="xis-paragraph">يتوفر هذا الخيار عند استخدامك لبيانات مُجمّعة، وينطبق على كلا عاملي تصفية الترتيبات وما بعد التجميع. يكون هذا الخيار غير متوفر إذا كان جدول القوائم يحتوي بالفعل على عامل تصفية تجميع أو إذا كان هناك ترتيب مع تحديد الخيار <span class\\="xis-windowItem">كل ما هو غير ذلك</span>.</p><p class\\="xis-paragraph">لا يمكن أن يكون جدول قائمة الذي يظهر بيانات تفصيلية هو المصدر لإجراء أو ارتباط.</p></section>',
