        "vaeua-gui-eua.Properties.tweedie.powerSpecification.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد كيفية تحديد معلمة Tweedie للطاقة.</p></section>',
        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.ReportReview.LowPercentageUsedColumns.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">أزِل الأعمدة غير المستخدمة في مصدر البيانات للتقرير لإزالة المشكلة التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية المنخفضة، تأكد من أن تقريرك يستخدم 10% من الأعمدة أو أكثر في مصدر البيانات.</p><p class\\="xis-paragraph">الأولوية المنخفضة\\: تستخدم &lt;\\= 10% من الأعمدة عندما يكون هناك 100 عمود أو أكثر في مصدر البيانات</p></section>',
        "vaeua-gui-eua.sas.van.Properties.object.title.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">قد لا ينطبق خيار العنوان التلقائي على بعض الكائنات، مثل قيمة المفتاح.</p></section>',
        "vaeua-gui-eua.Properties.factmac.learnStep.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد حجم خطوة التعلم لخوارزمية SGD. يمكن أن يجنب التعلم الأبطأ الملء الزائد للنموذج. قد يتم ضبط قيمة تعلم الخطوة لضمان أن خوارزمية التحسين تتقارب بشكل فعال.</p></section>',
