        "vaeua-gui-eua.Properties.svm.customPenaltyValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد قيمة جزاء للاستخدام. بشكل عام، تؤدي قيمة جزاء أكبر إلى متجهات دعم أقل.</p></section>',
