        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحاول إنشاء شبكة بايزي naïve لشجرة معززة، والذي تتضمن ارتباط مباشر من متغير الاستجابة لكل متنبئ، وكذلك بنية شجرة بين المتنبئين. تتطلب شبكات بايزي naïve ذات الشجرة المعززة أن يكون العدد الأقصى للأصول هو اثنين دائمًا.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
