        "vaeua-gui-eua.Properties.bayesNet.parentChild.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحاول إنشاء شبكة بايزي فرع-أصل، والتي توسع شبكة بايزي naïve. يسمح هذا التوسيع للمتنبئين أن يكونوا أصول لمتغير الاستجابة والارتباطات بين الأصول والفروع لمتغير الاستجابة والارتباطات بين الفروع لمتغير الاستجابة.</p></section>',
