        "vaeua-gui-eua.ModelComparisonBasePropertiesView.percentile.field.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد عمق مجموعات النسب المئوية التي تستخدم لحساب إحصاءات معينة. وتشتمل هذه الإحصاءات على المتوسط المُلاحظ والرفع التراكمي والنسبة المئوية التراكمية التي تم التقاطها والنسبة التراكمية للأحداث.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.linkType.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد ما إذا كانت الروابط بين العُقد موجهة (اتجاه واحد) أو غير موجهة (ثنائية الاتجاه). يؤثر نوع الرابط على حساب قياسات الشبكة. عند عرض أسهم الرابط، يحدد نوع الرابط اتجاه أسهم الرابط.</p></section>',
