        "vaeua-gui-eua.linearTickValueFitPolicy.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد خيار <span class\\="xis-windowItem">عرض قيم العلامات</span> الطريقة المستخدمة لملاءمة قيم علامة التحديد على المحور س. يمكنك تحديد إما <span class\\="xis-windowItem">تقليل التراكب تلقائيًا</span> أو <span class\\="xis-windowItem">الاتجاه الثابت</span>.</p><div class\\="xis-paragraph">يتم تطبيق خيار <span class\\="xis-windowItem">تقليل التداخل تلقائيًا</span> فقط عند تداخل قيم العلامات. يمكنك تحديد ما يلي\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">إفلات البعض</span></td><td>يقوم بإسقاط بعض قيم العلامات.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة</span></td><td>يدور كل قيم العلامات 45 درجة قطريًا.</td></tr></table></div>                 </div><div class\\="xis-paragraph">يتم تطبيق خيار <span class\\="xis-windowItem">الاتجاه الثابت</span> دائمًا ويعين اتجاه القيم. يمكنك تحديد ما يلي\\: <div class\\="xis-listValueDescription"><table><tr><td class\\="xis-value"><span class\\="xis-windowItem">أفقي</span></td><td>يعرض قيم العلامات أفقيًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة</span></td><td>يدور كل قيم العلامات 45 درجة قطريًا.</td></tr><tr><td class\\="xis-value"><span class\\="xis-windowItem">التدوير بزاوية 45 درجة، إسقاط</span></td><td>يقوم بتدوير كل قيم العلامات 45 درجة قطريًا، ثم يسقط قيم العلامات.</td></tr></table></div>                 </div></section>',
