        "vaeua-gui-eua.Properties.linearRegression.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يوسع النموذج ليشمل الملاحظات ذات القيم المفقودة. يتم حساب التأثير المستمر مع المتوسط المُلاحظ، ويتم إنشاء متغير مؤشر يدل على المفقودين. ويعالج تأثير التصنيف القيم المفقودة باعتبارها مستوى متميزًا. </p></section>',
