        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد عدد تجمّعات لإنشائها، أو يحدد أنه يجب استخدام طريقة معيار المربع المحاذي (ABC) لاشتقاق العدد الأمثل لتجمّعات.</p><p class\\="xis-paragraph">تختار طريقة ABC أولاً بعض عدد تجمّعات لإنشائها، ويقوم بإنشاء التجمّعات، ويقوم بحساب إحصائية الفجوة لكل تجمّع. فيما بعد، يتم إنشاء توزيع مرجع موجّهة نحو كل تجمّع ويتم حساب إحصائية الفجوة لكل توزيع مرجع. هذه العملية مكررة لكل عدد التجمّعات المحتمل. يتم اختيار عدد التجمّعات الذي يزيد إجمالي الفارق بين إحصائيات الفجوة للتجمعات وبيانات المرجع كالعدد الأمثل للتجمّعات.</p><p class\\="xis-paragraph">طريقة ABC صالحة فقط عندما تكون كل المدخلات متغيرات للقياس.</p></section>',
