        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يستخدم العدد الافتراضي لأدوات التوقع للتجربة بالنسبة لكل تقسيم. الافتراضي هو الجذر التربيعي للعدد الإجمالي لأدوات التوقع. أو بشكل آخر، حدد عدد أدوات التوقع للتجربة بالنسبة لكل تقسيم.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد عدد الخانات المراد استخدامها لتصنيف متغيرات القياس في مخطط الاعتماد الجزئي.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يُمكن خوارزمية التجميع التصنيفي بواسطة (K) وتجاهل ترتيب المجموعة. لا تحدد هذا الخيار إذا كنت ترغب في استخدام خوارزمية البحث الجشع واحترام ترتيب المجموعة. وتستخدم استجابات القياس غير المقيدة التباين كمعيار التحديد. عند تحديد هذا الخيار، تستخدم استجابات الفئة وإجراءات الردود المثبتة معيار نسبة الربح. وإلا، يتم استخدام الربح المطلق.</p></section>',
