        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحاول إنشاء شب شبكة بايزي naïve وشبكة بايزي naïve معززة. تحدد شبكة بايزي naïve أن متغير الاستجابة يمثل فقط الأصل لجميع المتنبئين. يفترض استقلال مشروط لجميع المتنبئين، متغير الاستجابة المقدم. شبكة بايزي naïve معززة، تقوم شبكة بايزي بتوسيع شبكة naïve بالسماح لعقد المتنبئ إلى نموذج شبكة بايزي.</p></section>',
