        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">ينشئ علامات HTML المخصصة حتى يمكن دمج الكائن أو التقرير في صفحة ويب.</p><p class\\="xis-paragraph">لتمكين إشارات مخصصة في صفحة الويب لديك، يجب أن تضيف علامات &lt;script&gt; لرأس صفحتك. للمزيد من المعلومات حول محتوى SAS Visual Analytics، راجع <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">وثائق SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يتحكم خيار <span class\\="xis-windowItem">تباعد المجموعة</span> في عرض المسافة بين المجموعات للأشرطة المجمعة. إذا كنت تريد تغيير المسافة بين الأشرطة، حدد خيار <span class\\="xis-windowItem">التباعد</span>.</p></section>',
