        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد الحد الأقصى للقيمة الأولية (الحد العلوي) لعنصر التحكم. يتم تحديد القيمة الأولية أول مرة يفتح فيها مستخدم التقرير، أو عندما يحدد مستخدم <span class\\="xis-windowItem">استعادة حالة التقرير الافتراضية</span>. </p><div class\\="xis-paragraph">أدخِل قيمة في حقل النص، أو حدد أحد الخيارات التالية\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تلقائي</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن اختيارك محفوظ كالقيمة الأولية عندما تحفظ التقرير. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">الحد الأقصى للقيمة</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن أكبر قيمة في عنصر التحكم هي القيمة الأولية.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">اسم المعلمة</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن القيمة للمعلمة التي تحددها هي القيمة الأولية لعنصر التحكم.</p><p class\\="xis-paraSimple">يمكنك تحديد معلمة فقط إذا كانت المعلمة ذات نوع البيانات المناسب موجودة بالفعل.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">يحدد كيفية استخدام حركة المرور لحساب وقت السفر لميزة الرسم. حدد أحد الخيارات التالية\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">لا</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن حساب وقت السفر يستخدم متوسطًا موزونًا لبيانات حركة المرور السابقة لجميع أوقات اليوم ولجميع أيام الأسبوع.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">المرور الحالي</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يحدد أن حساب وقت السفر يستخدم شروط حركة المرور الحالية. يمكن تحديث بيانات حركة المرور هذه بالنقر على <span data-icon-name\\="refresh" alt\\="أيقونة تحديث بيانات حركة المرور" aria-label\\="أيقونة تحديث بيانات حركة المرور"></span>. عندما يعرض أحد المستخدمين التقرير، لا يتم تحديث حركة المرور تلقائيًا. يجب على المستخدم تحديث بيانات حركة المرور لتعكس أحدث ظروف حركة المرور.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">المرور النموذجي</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> تحدد أن حساب وقت السفر يستخدم حركة المرور النموذجية للوقت واليوم المحددين من الأسبوع. تعتمد ظروف حركة المرور النموذجية على بيانات المحفوظات الحديثة.</p><div class\\="xis-note"><span class\\="xis-noteGenText">ملاحظة\\:</span> الوقت الذي تحدده هو الوقت المحلي للموقع على الخريطة.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">ملاحظة\\:</span>يستهلك استرداد بيانات وقت السفر أرصدة خدمات Esri المتميزة.</div><div class\\="xis-note"><span class\\="xis-noteGenText">ملاحظة\\:</span>إذا لم تتوفر بيانات حركة المرور للمنطقة التي تحتوي على حساب وقت السفر، فسيتم استخدام حدود السرعة المُعلنة لحساب وقت السفر.</div></section>',
