        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">التأثيرات المكونة من كل زوج من العناصر المحددة. يتطلب هذا التأثير عنصرَين على الأقل.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">حدد المتغير لاستخدام تقسيم العقدة. يتم فرز المتغيرات حسب استحقاق السجل، لقياس مدى تقسيم ذلك المتغير للبيانات. يمثل استحقاق السجل السجل السلبي لقيمة p من اختبار مربع كاي.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يظهر نظرة عامة للمحور.</p><p class\\="xis-paragraph">لا يتوفر هذا الخيار في حال تعيين أكثر من عنصرين بيانات للمخطط.</p></section>',
