        "vaeua-gui-eua.Properties.svm.defaultiteration.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يستخدم العدد الأقصى الافتراضي لعدد مرات التكرار قبل توقف عملية ملاءمة النموذج. الافتراضي هو 25.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يستخدم الحد الأدنى الافتراضي للسماح المطلق الذي يتوقف عنده التكرار. الافتراضي هو 1.0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">أزِل عناصر التحكم من منطقة المطالبة بالصفحة لإزالة المشكلة التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية المتوسطة، قلّل عدد عناصر التحكم في منطقة المطالبة بالصفحة إلى 10 أو أقل.</p><p class\\="xis-paragraph">الأولوية المتوسطة\\: تحتوي على &gt; 10 كائنات في منطقة المطالبة بالصفحة.</p></section>',
