        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يختبر كل متنبئ للاستقلال المشروط لمتغير الاستجابة المقدم لأي متنبئ آخر ضمن اختبار استقلال إحصائي محدد. يرفض تحديد <span class\\="xis-windowItem">تحديد المتغير</span> المتنبئين الذين يكونون مستقلين بشكل مشروط من متغير الاستجابة المقدم لأي متنبئ آخر.</p></section>',
