        "vaeua-gui-eua.Properties.assessment.cutoff.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد انقطاع احتمالية التنبؤ الذي يحدد ما إذا كانت الملاحظة هي حدث نموذجي.</p></section>',
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">اضبط تخطيط تقريرك لتجنب الحاويات المتداخلة وإزالة المشاكل التالية. على سبيل المثال، لإزالة المشاكل ذات الأولوية العالية، تأكد من أن هناك 6 حاويات متداخلة أو بعضها في تخطيط تقريرك.</p><p class\\="xis-paragraph">الأولوية المنخفضة\\: تحتوي على &gt; حاويتان متداخلتان</p><p class\\="xis-paragraph">الأولوية المتوسطة\\: تحتوي على &gt; 4 حاويات متداخلة</p><p class\\="xis-paragraph">الأولوية العالية\\: تحتوي على &gt; 6 حاويات متداخلة</p></section>',
