        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد معدل التلدن لاستخدامه لتحسين SGD. وتساعد القيمة غير الصفرية على تقارب النموذج قرب حد أدنى محلي لوظيفة الهدف.</p></section>',
