        "vaeua-gui-eua.Properties.predAuto.showSubgroups.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد ما إذا كان سيتم حساب المجموعات وعرض أعلى ثلاث مجموعات وأدنى ثلاث مجموعات في النتائج. يتم تشغيل العديد من أشجار القرارات على متغير الاستجابة المحدد، وتوضح كل مجموعة ورقة في إحدى أشجار القرارات هذه.</p></section>',
