        "vaeua-gui-eua.Properties.neuralnetwork.validateError.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد الحد الأقصى لخطأ التحقق المقبول لاستكمال تدريب النموذج. عندما يكون خطأ التحقق أقل من قيمة الهدف المحددة، يتم إنهاء التدريب النموذجي.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.standardization.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.discreteTickValueFitPolicy.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Distribution.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد وظيفة التوزيع المستخدمة لنموذج المتغير التابع.</p></section>',
        "vaeua-gui-eua.dataElementStyleRotation.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">خيار <span class\\="xis-windowItem">تدوير نمط عنصر البيانات</span> يحدد كيفية تعيين الأنماط على عناصر البيانات في قالب الرسوم. في مخطط خطي، على سبيل المثال، يحدد هذا الخيار كيفية استخدام الألوان وأنماط الخطوط والعلامات للتمييز بين الخطوط في الرسم. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تلقائي</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يستخدم إعداد تدوير النمط من النسق. تستخدم معظم نُسق SAS إعداد <span class\\="xis-windowItem">تدوير كل الألوان أولاً</span>. يستخدم نسق التباين العالي إعداد <span class\\="xis-windowItem">تدوير جميع السمات</span>.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تدوير كل الألوان أولاً</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يعرض ملء ثابت وخط ثابت وشكل علامة ثابت حتى يتم استخدام كل الألوان في لوح الألوان.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تدوير جميع السمات</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يعرض أنماط الملء المختلفة وأنماط الخطوط وأشكال العلامات بالإضافة إلى ألوان مختلفة. يمكن أن يحسّن هذا الإعداد قابلية الوصول للمستخدمين برؤية ناقصة الألوان (عمى الألوان).</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterOne.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">تحدد معلمة (معامل) المقياس في وظيفة sigmoid.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communities.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يحدد عدد المجتمعات (مجموعات العقدة المحلية) المراد حسابها داخل كل مجموعة من العُقد. لاحظ أن العدد الإجمالي للمجتمعات المحسوبة قد يكون أقل من القيمة المحددة، اعتمادًا على بنية الشبكة وحجمها.</p></section>',
