        "vaeua-gui-eua.Properties.bayesNet.includeMissing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">تعامل عوامل التنبية الفئوية قيمة مفقودة كقيمة منفصلة. يستبدل متنبئ مستمر قيمة مفقودة مع متوسط المتنبئ. بالنسبة لشبكات بايزي، لا يتم تضمين القيم المفقودة في متغير الاستجابة.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.Properties.svm.defaultpenalty.help.tip.txt": "المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.groupingScale.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">خيار <span class\\="xis-windowItem">مقياس التجميع</span> يحدد كيفية قياس المخططات الشريطية المجمّعة. يمكن تكديس الأشرطة أو نظمها في مجموعات. <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">القيم الفعلية</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يقوم بضبط حجم الأشرطة بناءً على القيم الموجودة في البيانات. نفترض على سبيل المثال أن شريطًا في مجموعة واحدة بقيمة 50 وشريطًا آخر في مجموعة أخرى بقيمة 500. سيكون الشريط بقيمة 500 أطول بمقدار 10 أضعاف الشريط بقيمة 50.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">تقليل تكرار المجموعات إلى 100%</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">يقدم المجموعات باستخدام مقياس نسبي. ضمن مجموعة، يتم عرض كل شريط كنسبة مئوية من المجموعة. نفترض على سبيل المثال أن مجموعة بقيمة كلية 100. إذا كان شريط ضمن تلك المجموعة بقيمة 50، فيكون ارتفاع الشريط بنسبة 50٪ من ارتفاع المجموعة الإجمالية.</p></dd></dl></div>                 </div><p class\\="xis-paragraph">هذا الخيار غير متوفر عند احتواء كائن الرسم على عناصر رسم متراكبة. هذا الخيار غير متوفر كذلك عندما تحدد نفس نطاق البيانات للمحاور في شبكية ما.</p></section>',
        "vaeua-gui-eua.connectOrder.help.aria.txt": "التعليمات. المزيد من المعلومات عن هذا الخيار ",
        "vaeua-gui-eua.properties.sankey.linkColor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">يلون الارتباطات إما عن طريق المسارات التي ينتمون إليها أو الأحداث التي تبدأ من خلالها أو ما إذا كانت ارتباطات منسدلة.</p></section>',
